                    </div>

                    <div className="admin-skills">
                        <h2>Skills</h2> 
                        <form>
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <button>Apply Skills</button> 
                        </form>  
                    </div>

                </div>
            </div>

        )
    }
}

export default AdminBio;
